import React from "react";
import { connect } from "react-redux";

const ImagesList = ({ proccess }) => (

    <div>
        {proccess.uploadImage.showAlertMessage ? <div className="alert alert-danger" role="alert">{proccess.uploadImage.alertMessage}</div> : null}
        
        {proccess.uploadImage.showResultMessage ?  

        <div className="alert alert-success" role="alert">
            <p>{proccess.uploadImage.resultMessageSize}</p>
            <p>{proccess.uploadImage.resultMessageOrientation}</p>
        </div> : null 
        }
    </div>
        
    
)

const mapStateToProps = (state) => {
    return {
        proccess : state 
    }
}


export default connect(mapStateToProps)(ImagesList);
